// Solution 1:
function removeDuplicateLetters(str) {
    let stack = [];
    const freqMap = {};
    for (let char of str) {
        if (!freqMap[char]) {
            while (stack.length && stack[stack.length - 1] > char && freqMap[stack[stack.length - 1]] >= 1) {
                stack.pop();
            }
            stack.push(char);
            freqMap[char] = 1;
        } else {
            freqMap[char]++;
        }
    }
    return stack.join('');
}

console.log(removeDuplicateLetters(['c', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'c', 'a', 'a', 'a', 'g', 'a', 'a', 'a'])) // "ccccaacggaaa"
console.log(removeDuplicateLetters(['a', 'a', 'a', 'a', 'a', 'a', 'a', 'f', 'f', 'f', 'f', 'f', 'a', 'a', 'g', 'a', 'a'])) // "aaaaaaaaafggaaaa"
console.log(removeDuplicateLetters(['a', 'i', 'i', 'i', 'i', 'i', 'i', 'i', 'i', 'a', 'a', 'a', 'g', 'a', 'a', 'a', 'a'])) // "aiiiiiiiigaaaa"
